import React from 'react';

import { Row, Col } from 'react-bootstrap';


function Portfolio () {
    return (
        <section class="portfolio">
            <h2>Portfolio</h2>
            <div>
                Featured project
            </div>
            <Row>
                <Col>Fetch</Col>
                <Col>BoredAf</Col>
                <Col>Portfolio 1</Col>
            </Row>
        </section>
    );
}

export default Portfolio;
